import "./Navbar.css"
import {withRouter} from "../../withRouter"
import React, { Component } from 'react'
import { GoogleOAuthProvider, GoogleLogin } from "@react-oauth/google"

class Navbar extends Component {
  handleClick()
  {
    this.props.navigate('/Login')
  }

  
  render() {
    let button = <GoogleOAuthProvider clientId="933155331955-95a3jte5q214fvbkt260cl9gehv13bd1.apps.googleusercontent.com">
    <GoogleLogin onSuccess={credentialResponse => {handleLogin(credentialResponse)}}onError={() => {console.log('Login Failed');}}/>
    </GoogleOAuthProvider>
    if(sessionStorage.getItem('token'))
    {
      button = <div></div>
    }
    return (
      <div>
        <div className="navbar">
            <div className="navbarcontainer">
                <div className="navtitle">
                    <span className="title">Academic Planner</span>
                </div>
                {button}
            </div>
        </div>
      </div>
    )
  }
}

export default withRouter(Navbar)
